  componentDidMount() {
    window.scroll(0, 0);
  }
  render() {
    return (
      <Fragment>
        <PageTop pagetitle="ডিজিটাল টেকনোলজি" />
        <Ecom />
      </Fragment>
    );
  }
}

export default EcomPage;
